text:
 @DaviFerreira-le6pe  

Time fraco que jogou oitavas de LIBERTADORES e quartas de COPA DO BRASIL?
Ano passado o FORTALEZA foi o quarto colocado no Brasileirão.

 @DaviFerreira-le6pe  

Meu colega você primeiro menosprezou o FORTALEZA o chamando de fraco,eu só quis dizer que se ele fosse tão fraco assim não estaria na primeira DIVISÃO e jogando LIBERTADORES,inclusive ano passado o FORTALEZA terminou o brasileiro na frente do Corinthians,e na copa do Brasil também chegando na SEMIFINAL.
Não falei em conquistas,só respondi a um desrespeito.

 @Jclaudson7  

Sinto muito colega,ele já está alguns  anos seguidos na primeira DIVISÃO.
Há já olhou a tabela do Brasileirão atualizada? acho que o FORTALEZA não vai cair não viu.

 @edreverso-bgedreverso-bg9372  Flamengo VS Corinthians ou Fluminense seria incrível. 
São Paulo VS Corinthians também séria incrível. 

Única final que seria chata, é, São Paulo × Fluminense.
